import React, { useState, useEffect } from "react";
import PrimerPanel from "./Componentes/chars/verticalChar";
import "./App.css";
import { db } from "./servicios/firebase";
import { useDispatch, useSelector } from "react-redux";

import {
  fnAsignarDatos1,
  fnAsignarDatos2,
  fnAsignarDatos3,
  fnAsignarDatos4,
  selectDatos1,
  selectDatos2,
  selectDatos3,
  selectDatos4,
} from "./redux/app/appSlice";

import "firebase/auth";
import {
  Container,
  Col,
  Row,
  Button,
  Card,
  ListGroup,
  Navbar,
} from "react-bootstrap";

const Canva = () => {
  let datos1 = useSelector(selectDatos1);
  let datos2 = useSelector(selectDatos2);
  let datos3 = useSelector(selectDatos3);
  let datos4 = useSelector(selectDatos1);

  const miData_ResponseType = {
    labels: ["Botón1", "Boton2", "Boton3", "Boton4"],
    datasets: [
      {
        label: "Sesión1",
        backgroundColor: "rgba(255,99,132,0.2)",
        borderColor: "rgba(255,99,132,1)",
        borderWidth: 1,
        hoverBackgroundColor: "rgba(255,99,132,0.4)",
        hoverBorderColor: "rgba(255,99,132,1)",
        data: datos1,
      },
      {
        label: "Sesión2",
        backgroundColor: "rgba(0, 181, 204, 0.4)",
        borderColor: "rgba(0, 181, 204, 1)",
        borderWidth: 1,
        hoverBackgroundColor: "rgba(0, 181, 204, 0.4)",
        hoverBorderColor: "rgba(0, 181, 204, 1)",
        data: datos2,
      },
      {
        label: "Sesión3",
        backgroundColor: "rgba(41, 241, 195, 0.4)",
        borderColor: "rgba(41, 241, 195, 1)",
        borderWidth: 1,
        hoverBackgroundColor: "rgba(41, 241, 195, 0.4)",
        hoverBorderColor: "rgba(255,99,132,1)",
        data: datos3,
      },
      {
        label: "Sesión4",
        backgroundColor: "rgba(247, 202, 24, 0.4)",
        borderColor: "rgba(247, 202, 24, 1)",
        borderWidth: 1,
        hoverBackgroundColor: "rgba(247, 202, 24, 0.4)",
        hoverBorderColor: "rgba(247, 202, 24, 1)",
        data: datos4,
      },
    ],
  };

  const asignador = useDispatch(); //Se encarga de asgnar los datos a nuestras variables globales
  const tablaAllData = db.ref("/AllData");
  const tablaMetricos = db.ref("/metricos");

  const escribirDatos = (
    responseTimeVariability,
    responseTime,
    errorComission,
    errorOmission
  ) => {
    tablaMetricos.push({
      ResponseTimeVariability: responseTimeVariability,
      ResponseTime: responseTime,
    });
  };

  useEffect(() => {
    //Escribir información
    tablaAllData.once("value", function (snapshot) {
      let objetos = [];

      snapshot.forEach(function (childSnapshot) {
        var key = childSnapshot.key;
        var data = childSnapshot.val();
        // ...

        objetos.push({
          key: key,
          tiempo: data.Extime,
          correcto: data.Excorrect,
        });
      });
      console.log(objetos);
    });

    escribirDatos();
  });

  return (
    <Container>
      <Navbar bg="dark" variant="dark" style={{ marginBottom: "20px" }}>
        <Navbar.Brand href="#home">Panel de administradores</Navbar.Brand>
      </Navbar>
      <Row className="justify-content-md-center">
        <Col style={{ height: "230px" }}>
          <PrimerPanel
            data={miData_ResponseType}
            titulo="Response Time Var"
            className="tabla"
          />
          <PrimerPanel data={miData_ResponseType} titulo="Response Time" />
        </Col>

        <Col style={{ height: "230px" }}>
          <PrimerPanel data={miData_ResponseType} titulo="Comissions" />
          <PrimerPanel data={miData_ResponseType} titulo="Omission" />
        </Col>
      </Row>
      <Row className="justify-content-md-center">
        <Button variant="outline-primary" className="btn_select" active>
          Response Time Var
        </Button>{" "}
        <Button variant="outline-primary" className="btn_select" active>
          Response Time
        </Button>{" "}
        <Button variant="outline-primary" className="btn_select" active>
          Comissions
        </Button>{" "}
        <Button variant="outline-primary" className="btn_select" active>
          Omission
        </Button>{" "}
      </Row>
    </Container>
  );
};

function App() {
  return (
    <Container className="App">
      <Canva />
    </Container>
  );
}

export default App;
